import React, { Component } from 'react'
import "../../Css/AllProjects.css";
import {  Switch, Route, Link} from "react-router-dom";
import AsFreelancer from './AsFreelancer';
import AsClient from './AsClient';
import NavName from './NavName'
import Applicants from './Applicants';
import FreelancerProfile from './FreelancerProfile';
import Inbox from './Inbox';


export default class AllProjects extends Component {
    render() {

        return (
            
             <div className="allProjects">
                 <NavName pageName="All Project" pageDescription="See all your project that you posted or applied."  />
                   <div className="switchBtn">
                        <Link to="/asFreelancer" style={{textDecoration:0}}><button className="asFreelancer">As Freelancer</button></Link>
                         <Link to="/asClient" style={{textDecoration:0}}><button className="asClient">As Client</button></Link>
                    </div>
                <div className="allProjects_body">
                     <Switch>
                                 <Route   path="/applicantProfile">
                                    <FreelancerProfile />
                                </Route>  
                                <Route   path="/applicants">
                                    <Applicants />
                                </Route>  
                                <Route   path="/asClient">
                                    <AsClient />
                                </Route>
                                 <Route  path="/asFreelancer">
                                    <AsFreelancer />
                                </Route>
                                 <Route  path="/inbox">
                                     <Inbox/>
                                 </Route>
                            </Switch>
                </div>
            </div>
        )
    }
}
